    playbackData.comments = {"ed1839e0-1725-4458-b7b8-872a6733fb75":[{"id":"b6375dc7-08a4-4113-82b5-7671fee7491f","displayCommentEventId":"ed1839e0-1725-4458-b7b8-872a6733fb75","displayCommentEventSequenceNumber":0,"developerGroupId":"e396af79-ca57-49ea-bed5-5d1a821aaf1b","timestamp":1728925352068,"commentText":"A short playback discussing how to debug when string splitting doesn't go as planned.","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"","viewableBlogText":"","commentTags":[],"questionCommentData":null}],"f5db0140-6310-4dbc-8acc-e0aa33976fdf":[{"id":"aebc43b0-06a9-40b4-9f82-409d49a2c287","displayCommentEventId":"f5db0140-6310-4dbc-8acc-e0aa33976fdf","displayCommentEventSequenceNumber":89,"developerGroupId":"6f01838f-081b-48a3-a701-b9a25e31678e","timestamp":1728927108490,"commentText":"","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":["media/videos/1728938873461-ISBN-10.mp4"],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/strings_II.R","viewableBlogText":"","commentTags":["video"],"questionCommentData":null}],"66f7dfd3-90c9-4ac8-8826-01272e58401c":[{"id":"d9f946d9-15e0-46b0-bcb8-3a982db7c79e","displayCommentEventId":"66f7dfd3-90c9-4ac8-8826-01272e58401c","displayCommentEventSequenceNumber":271,"developerGroupId":"6f01838f-081b-48a3-a701-b9a25e31678e","timestamp":1728927227618,"commentText":"Now that we are better at dealing with strings, I always prefer to separate the name of a file and a the path to a file.&nbsp; I almost always start code this way, and can copy/paste into other files and modify more easily if files get renamed or relocated.&nbsp;&nbsp;<div><br></div><div>Also, keeping things as variables makes the process more human readable to other coders, and is more descriptive as to what is being done.</div>","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/strings_II.R","viewableBlogText":"","commentTags":[],"questionCommentData":null}],"b4577388-fa32-4edc-8aca-b8aa3a891f6f":[{"id":"787b01cf-414c-4eb1-8275-d5bd4a8de203","displayCommentEventId":"b4577388-fa32-4edc-8aca-b8aa3a891f6f","displayCommentEventSequenceNumber":290,"developerGroupId":"6f01838f-081b-48a3-a701-b9a25e31678e","timestamp":1728927351437,"commentText":"As outlined in the introductory video, we are imagining dealing with an inventory list of books today.&nbsp; Our data frame <span style=\"font-family: Courier;\">products</span> can be visualized here: a data frame with some number of rows and 2 columns, one called <span style=\"font-family: Courier;\">product</span> and one called <span style=\"font-family: Courier;\">ISBN</span>.&nbsp; As ISBN numbers contain information in each of the parts, we wish to ultimately add that information&nbsp; / data to our data frame for better analysis.&nbsp;","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":["media/images/1728927286780-ISBN1.PNG"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/strings_II.R","viewableBlogText":"","commentTags":["image"],"questionCommentData":null}],"ad57ffa9-b4b7-4523-8300-e266c8dcf507":[{"id":"a1a2f4a9-fd8e-4508-991f-71b033241965","displayCommentEventId":"ad57ffa9-b4b7-4523-8300-e266c8dcf507","displayCommentEventSequenceNumber":449,"developerGroupId":"6f01838f-081b-48a3-a701-b9a25e31678e","timestamp":1728927510125,"commentText":"If we try to break our ISBN numbers into four parts (the group id, publisher id, title id, and check digit), we get the error message shown below.<div><br></div><div><div>Remember that error messages <span style=\"font-weight: bold;\">try</span>&nbsp;to be informative.&nbsp; Here, we are told that exactly 2 values were too long (contained more than four pieces) and that there are various things we could do to address the problem.</div></div>","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":["media/images/1728927399421-ISBNError.PNG"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/strings_II.R","viewableBlogText":"","commentTags":["image"],"questionCommentData":null}],"add1dc3d-3dc7-40cd-a1de-817a4b315996":[{"id":"ede7ae54-f0de-4f4e-81b9-1fd1c0174e1a","displayCommentEventId":"add1dc3d-3dc7-40cd-a1de-817a4b315996","displayCommentEventSequenceNumber":490,"developerGroupId":"6f01838f-081b-48a3-a701-b9a25e31678e","timestamp":1728928015814,"commentText":"Let's try one of the things suggested by the error message.&nbsp; Let's add <span style=\"font-family: Courier;\">too_many = \"debug\"</span> to <span style=\"font-family: Courier;\">df2</span> and view the output (shown below).<div><br></div><div>Adding <span style=\"font-family: Courier;\">too_many = \"debug\"</span> will add three columns to our data frame <span style=\"font-family: Courier;\">df2</span>: always <span style=\"font-family: Courier;\">col_ok, col_pieces, col_remainder</span>., where <span style=\"font-family: Courier;\">col</span> is the column on which we tried to separate (here, <span style=\"font-family: Courier;\">ISBN</span>).&nbsp; Let's discuss what goes into these new columns.</div><div><br></div><div>1) The values in <span style=\"font-family: Courier;\">col_ok</span> will always be logical values (i.e. taking on the values of <span style=\"font-family: Courier;\">TRUE</span> or <span style=\"font-family: Courier;\">FALSE</span>) to let us know whether <span style=\"font-family: Courier;\">separate_wider_delim()</span> worked correctly or not on that row.</div><div>2) The values in <span style=\"font-family: Courier;\">col_pieces</span> always tells you the number of columns <span style=\"font-family: Courier;\">separate_wider_delim()</span>&nbsp;could have populated if splitting that row on that delimiter.</div><div>3) The values in <span style=\"font-family: Courier;\">col_remainder</span> show us what is extra; that is, what will ultimately be left over if we just put the first values it encounters into the columns given in<span style=\"font-family: Courier;\"> names</span>.</div><div><br></div><div>I've scrolled down in the image to the rows that are problematic in this example so you can see what happens both with good (<span style=\"font-family: Courier;\">ISBN_ok = TRUE</span>) and bad (<span style=\"font-family: Courier;\">ISBN_ok = FALSE</span>) data.</div>","commentTitle":"","position":1,"selectedCodeBlocks":[],"imageURLs":["media/images/1728927592990-ISBN2.PNG"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/strings_II.R","viewableBlogText":"","commentTags":["col_ok","col_pieces","col_remainder","debug","too_many","image"],"questionCommentData":null},{"id":"12cba3f9-8ef0-43f3-8f41-cc6ece9c1d9a","displayCommentEventId":"add1dc3d-3dc7-40cd-a1de-817a4b315996","displayCommentEventSequenceNumber":490,"developerGroupId":"6f01838f-081b-48a3-a701-b9a25e31678e","timestamp":1728939500428,"commentText":"I'll also add here that sometimes (not in this example) we encounter instances where we have too few outputs from the <span style=\"font-family: Courier;\">separate_wider_delim()</span> based on the delimiter.&nbsp; There is also a <span style=\"font-family: Courier;\">too_few</span> argument that can be passed to <span style=\"font-family: Courier;\">separate_wider_delim() </span>in such instances (the compiler will help you figure out when to use which debugging method via error messages).","commentTitle":"","position":1,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/strings_II.R","viewableBlogText":"","commentTags":[],"questionCommentData":null}],"dfc15d14-5a4c-4209-87e7-447967019a9a":[{"id":"008be643-98bd-4964-8d40-fd9e71760e13","displayCommentEventId":"dfc15d14-5a4c-4209-87e7-447967019a9a","displayCommentEventSequenceNumber":540,"developerGroupId":"6f01838f-081b-48a3-a701-b9a25e31678e","timestamp":1728928216920,"commentText":"<div>Here is the output of <span style=\"font-family: Courier;\">View(df2)</span> scrolled down to the rows that are problematic in this example so you can see what happens both with good (<span style=\"font-family: Courier;\">ISBN_ok = TRUE</span>) and bad (<span style=\"font-family: Courier;\">ISBN_ok = FALSE</span>) data.<br></div>","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":["media/images/1728928214016-ISBN2.PNG"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/strings_II.R","viewableBlogText":"","commentTags":["image"],"questionCommentData":null}],"27391a1d-b3f6-4a4a-a8a4-784958824718":[{"id":"923c3ae2-98e1-4d0d-811f-ac2afc16dcc6","displayCommentEventId":"27391a1d-b3f6-4a4a-a8a4-784958824718","displayCommentEventSequenceNumber":609,"developerGroupId":"6f01838f-081b-48a3-a701-b9a25e31678e","timestamp":1728928370142,"commentText":"","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":["media/videos/1728939513370-ISBN-13.mp4"],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/strings_II.R","viewableBlogText":"","commentTags":["video"],"questionCommentData":null}],"75667b2a-d701-47b0-ba18-a794df2a934a":[{"id":"731b810d-e1be-4f8c-98b0-8f37155e20c6","displayCommentEventId":"75667b2a-d701-47b0-ba18-a794df2a934a","displayCommentEventSequenceNumber":659,"developerGroupId":"6f01838f-081b-48a3-a701-b9a25e31678e","timestamp":1728928500431,"commentText":"Our example was small, so it wasn't hard to scroll and find the issue.&nbsp; On bigger data sets (think <span style=\"font-family: Courier;\">flights</span> or the like) this might not be feasible.&nbsp; Using a filter (remember,<span style=\"font-family: Courier;\"> ! </span>mean \"not\", but you could also have done <span style=\"font-family: Courier;\">ISBN_ok == FALSE</span> in the <span style=\"font-family: Courier;\">filter</span>) can direct you to issues more swiftly.&nbsp;&nbsp;","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":["media/images/1728928391831-ISBN3.PNG"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/strings_II.R","viewableBlogText":"","commentTags":["image"],"questionCommentData":null}],"40552ff0-1e63-4641-b4b9-0402a327bbdd":[{"id":"3a7eaa5c-d385-4261-8e8b-5111ecd56f11","displayCommentEventId":"40552ff0-1e63-4641-b4b9-0402a327bbdd","displayCommentEventSequenceNumber":832,"developerGroupId":"6f01838f-081b-48a3-a701-b9a25e31678e","timestamp":1728928658666,"commentText":"Now that we know the source of the issue AND how to handle it, we can create five columns instead of four.&nbsp; But we aren't done yet - we still need to communicate to <span style=\"font-family: Courier;\">separate_wider_delim() </span>what to do when something doesn't have five values when we split according to this delimiter.","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/strings_II.R","viewableBlogText":"","commentTags":[],"questionCommentData":null}],"e6f6624a-f926-43f1-ac3c-9d389d117d87":[{"id":"6c4b0666-2e9f-4edd-84dd-0522a511cc27","displayCommentEventId":"e6f6624a-f926-43f1-ac3c-9d389d117d87","displayCommentEventSequenceNumber":884,"developerGroupId":"6f01838f-081b-48a3-a701-b9a25e31678e","timestamp":1728928842999,"commentText":"Because some of our values will split into five pieces and others four, we tell <span style=\"font-family: Courier;\">separate_wider_delim()</span> what to do when it encounters four values.&nbsp; In these cases, we want to align with the end and leave the first column, <span style=\"font-family: Courier;\">prefix,</span> blank.&nbsp; If we had wanted to align with the start and leave ending columns blank, we would have used <span style=\"font-family: Courier;\">\"align_start\"</span> instead.<div><br></div><div>We can differentiate ISBN-13s from ISBN-10s by the <span style=\"font-family: Courier;\">NA</span> value in the&nbsp;<span style=\"font-family: Courier;\">prefix</span>&nbsp;column and align the remaining parts of the code properly.&nbsp; This goes to show that we don't always want to fill <span style=\"font-family: Courier;\">NA</span> values, as they sometimes communicate information to us!&nbsp;&nbsp;</div>","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/strings_II.R","viewableBlogText":"","commentTags":[],"questionCommentData":null}],"cbbf2bd4-6e59-4c4e-86eb-0406f2db7065":[{"id":"74a18071-a696-4b7f-bb9f-05f9831cf650","displayCommentEventId":"cbbf2bd4-6e59-4c4e-86eb-0406f2db7065","displayCommentEventSequenceNumber":934,"developerGroupId":"6f01838f-081b-48a3-a701-b9a25e31678e","timestamp":1728928871591,"commentText":"Last but not least, an image of our successfully formatted data.","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":["media/images/1728928867647-ISBN4.PNG"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/strings_II.R","viewableBlogText":"","commentTags":["image"],"questionCommentData":null}]};
